private void SetupCompartmentItems()\n{\n    var compartment = this.FindCompartment("CompartmentName");\n    if (compartment != null)\n    {\n        foreach (var item in this.ModelElement.Items)\n        {\n            compartment.AddItem(item);\n            Console.WriteLine($"Added item: {item.Name}");\n        }\n        Console.WriteLine($"Total items in compartment: {compartment.Items.Count}");\n    }\n    else\n    {\n        Console.WriteLine("Compartment not found");\n    }\n}